import React from "react";
import { Form, Button, Card, InputGroup } from "react-bootstrap";
import { FaEye, FaEyeSlash } from "react-icons/fa";
import { useState } from "react";

const LoginForm = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [showPassword, setShowPassword] = useState(false);

  const handleLoginSubmit = (event) => {
    event.preventDefault();
    // Add your login logic here
  };

  const togglePasswordVisibility = () => {
    setShowPassword(!showPassword);
  };

  return (
    <div className="d-flex flex-column align-items-center justify-content-center" style={{ height: "80vh" }}>
      <Card style={{ width: "400px", padding: "20px", border: "none", overflowY: "auto" }}>
        <h4 style={{ textAlign: "center", marginBottom: "40px" }}>Login</h4>
        <div style={{ maxHeight: "400px" }}>
          <Form style={{ marginBottom: "30px" }}>
            <Form.Group>
              <Form.Label>Email address</Form.Label>
              <Form.Control
                type="email"
                placeholder="Enter email"
                className="login-input"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </Form.Group>

            <Form.Group style={{ marginBottom: "10px" }}>
              <Form.Label>Password</Form.Label>
              <span style={{ fontSize: "16px", marginLeft: "130px" }}>
                <a href="https://www.youtube.com/watch?v=VZrDxD0Za9I" style={{ color: "#9FC856" }}>
                  Forgot Password?
                </a>
              </span>
              <InputGroup style={{ width: "350px" }}>
                <Form.Control
                  type={showPassword ? "text" : "password"}
                  className="login-input"
                  placeholder="Enter Password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                />

                <InputGroup.Text onClick={togglePasswordVisibility} style={{ cursor: "pointer" }}>
                  {showPassword ? <FaEyeSlash /> : <FaEye />}
                </InputGroup.Text>
              </InputGroup>
            </Form.Group>

            <Button variant="primary" type="submit" className="login" onClick={handleLoginSubmit}>
              LOGIN
            </Button>
          </Form>
        </div>
        <div style={{ textAlign: "center", fontSize: "14px" }}>
          Not registered? <a href="/register" style={{ color: "#9FC856" }}>Register</a>
        </div>
      </Card>
    </div>
  );
};

export default LoginForm;
